import React from 'react'
import lines from '../assets/lines2.png'
import styled from 'styled-components';

import {H1 } from '../components';

import marveledition from '../assets/marveledition.png'

const Style = styled.div`
  background: rgb(255,226,0);
  background: linear-gradient(180deg, rgba(255,226,0,1) 0%, rgba(255,163,0,1) 100%);
  height: 100vh;
  z-index: 3;

  &::before {
    position: absolute;
    left: 390px;
    margin-top: 110px;
    margin-left: auto;
    margin-right: auto;
    content:'${(props) => props.phasetext}';
    width: 10px;
    white-space: pre-line;
    line-height: 5rem;
    font-size: 1.2rem;
    font-weight: bold;
    color: #888;
  }

  h1 {
    margin-top: 250px;
  }

  .logo {

    width: 50%;
    border: 6px solid white;
  }

  .lines {
    margin-bottom: -10px;
    transform: rotate(180deg); 
  }

  .lines2 {
    margin-top: -5px;
  }

`;

function Blank() {
  return(
    <Style>
    <H1 big>THE WATCH ORDER</H1>

    <img className='lines' src={lines}/>

    <img className='logo' src={marveledition}/>

    <img className='lines2' src={lines}/>

    </Style>
  )
}


export default Blank;
